import { useState } from "react";
import CompSumUl from "./components/CompSumUl";

let arrList = ['1', '2', '3']

function App() {

  const [_showUl, _setShowUl] = useState(true)

  return (
    <>
      <h1>중첩컴포넌트</h1>
      {
        _showUl&&<CompSumUl />
      }
      <hr />
      <button onClick={e=>{_setShowUl(false)}}>문제삭제</button>
      <button onClick={e=>{_setShowUl(true)}}>문제제출</button>
    </>
  );
}

export default App;
